import React, { Component } from 'react'

class Courier extends Component {
  constructor(props) {
    super(props)
    this.state = {
      tn : this.props.location.state
    }
  }
  render() {

    return <div id="content"> {this.state.tn}</div>
  }
}

export default Courier
